INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (2, 2, "2023/09/22 14:59:59", 0.0, 1, 10003, "2023/06/30 12:00:00", 0.0, 126501, -470.0, 1, 2002, "ライラエル", "ショップへようこそ\nキャラバンコインはこちら\nで買い物に使えますよ");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (1, 1, "2023/09/22 14:59:59", 0.0, 1, 10004, "2023/06/30 12:00:00", 0.0, 126501, -470.0, 2, 2002, "ライラエル", "こちらのショップで\n買い物をして、素敵な\n旅を楽しんでくださいね");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (2, 2, "2023/12/22 14:59:59", 0.0, 2, 10005, "2023/09/15 15:00:00", 0.0, 127702, -470.0, 1, 2002, "リンド", "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (2, 2, "2023/12/22 14:59:59", 0.0, 2, 10006, "2023/09/15 15:00:00", 0.0, 127702, -470.0, 2, 2002, "リンド", "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (1, 1, "2023/12/22 14:59:59", 0.0, 2, 10007, "2023/09/15 15:00:00", 0.0, 127802, -470.0, 1, 2002, "ヴルム", "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (1, 2, "2023/12/22 14:59:59", 0.0, 2, 10008, "2023/09/15 15:00:00", 6.5, 127802, -470.0, 2, 2002, "ヴルム", "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (1, 2, "2024/03/22 14:59:59", 0.0, 3, 10009, "2023/12/15 15:00:00", 0.0, 129602, -470.0, 1, 2002, "アネモネ", "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (1, 2, "2024/03/22 14:59:59", 0.0, 3, 10010, "2023/12/15 15:00:00", 0.0, 129602, -470.0, 2, 2002, "アネモネ", "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (1, 1, "2024/03/22 14:59:59", 0.0, 3, 10011, "2023/12/15 15:00:00", 0.0, 129701, -470.0, 1, 2002, "ネフィ=ネラ", "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (1, 2, "2024/03/22 14:59:59", 0.0, 3, 10012, "2023/12/15 15:00:00", 6.2, 129701, -470.0, 2, 2002, "ネフィ=ネラ", "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (5, 3, "2024/06/22 14:59:59", 0.0, 4, 10013, "2024/03/15 15:00:00", 3.1, 130301, -470.0, 1, 2002, "カノン", "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (2, 3, "2024/06/22 14:59:59", 0.0, 4, 10014, "2024/03/15 15:00:00", 6.15, 130301, -470.0, 2, 2002, "カノン", "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (2, 2, "2024/06/22 14:59:59", 0.0, 4, 10015, "2024/03/15 15:00:00", 0.0, 130401, -470.0, 1, 2002, "ナーナ", "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (1, 2, "2024/06/22 14:59:59", 0.0, 4, 10016, "2024/03/15 15:00:00", 3.35, 130401, -470.0, 2, 2002, "ナーナ", "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (1, 1, "2024/09/22 14:59:59", 0.0, 5, 10017, "2024/06/15 15:00:00", 0.0, 130502, -470.0, 1, 2002, "ホウオウ", "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (1, 2, "2024/09/22 14:59:59", 0.0, 5, 10018, "2024/06/15 15:00:00", 3.18, 130502, -470.0, 2, 2002, "ホウオウ", "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (4, 4, "2024/09/22 14:59:59", 0.0, 5, 10019, "2024/06/15 15:00:00", 0.0, 130503, -470.0, 3, 2002, "ホウオウ", "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (2, 1, "2024/09/22 14:59:59", 0.0, 5, 10020, "2024/06/15 15:00:00", 4.9, 123301, -470.0, 1, 2002, "ネア", "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (2, 1, "2024/09/22 14:59:59", 0.0, 5, 10021, "2024/06/15 15:00:00", 4.8, 123301, -470.0, 2, 2002, "ネア", "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (1, 3, "2024/12/22 14:59:59", 0.0, 6, 10022, "2024/09/15 15:00:00", 4.922, 133301, -470.0, 1, 2002, "カリザ", "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (5, 3, "2024/12/22 14:59:59", 0.0, 6, 10023, "2024/09/15 15:00:00", 9.638, 133301, -470.0, 2, 2002, "カリザ", "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (2, 1, "2024/12/22 14:59:59", 0.0, 6, 10024, "2024/09/15 15:00:00", 2.88, 133401, -470.0, 1, 2002, "ミーア", "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (1, 5, "2024/12/22 14:59:59", 0.0, 6, 10025, "2024/09/15 15:00:00", 4.818, 133401, -470.0, 2, 2002, "ミーア", "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (1, 2, "2025/03/22 14:59:59", 0.0, 7, 10026, "2024/12/15 15:00:00", 1.78, 133002, -470.0, 1, 2002, "グレイス", "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (7, 1, "2025/03/22 14:59:59", 0.0, 7, 10027, "2024/12/15 15:00:00", 6.15, 133002, -470.0, 2, 2002, "グレイス", "商品をお買い上げ毎に\nグレイスちゃんポイントを\n差し上げます。嘘ですが");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (2, 6, "2025/03/22 14:59:59", 0.0, 7, 10028, "2024/12/15 15:00:00", 4.28, 133102, -470.0, 1, 2002, "ヴァイオレット", "ようこそいらっしゃいませ\n…接客とは、このような\n振舞で宜しいでしょうか？");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (1, 1, "2025/03/22 14:59:59", 0.0, 7, 10029, "2024/12/15 15:00:00", 0.0, 133102, -470.0, 2, 2002, "ヴァイオレット", "じめじめした商品は\nございませんので\n安心してお買い求め下さい");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (1, 2, "2025/06/23 14:59:59", 0.0, 8, 10030, "2025/03/15 15:00:00", 5.53, 136902, -470.0, 1, 2002, "ルルィ", "いらっしゃいましぇでしゅ\n何をお求めでしゅか？\nたこ焼きもありましゅよ！");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (7, 9, "2025/06/23 14:59:59", 0.0, 8, 10031, "2025/03/15 15:00:00", 6.05, 136902, -470.0, 2, 2002, "ルルィ", "そのコイン…ピカピカで、\n集めたくなっちゃいましゅ\nタコ釣られされちゃう～…");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (1, 2, "2025/06/23 14:59:59", 0.0, 8, 10032, "2025/03/15 15:00:00", 0.0, 137001, -470.0, 1, 2002, "デュラン", "姫のご友人ならば\n礼儀を尽くすのが爺の務め\nさ、望みの物を言いたまえ");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (1, 2, "2025/06/23 14:59:59", 0.0, 8, 10033, "2025/03/15 15:00:00", 0.0, 137001, -470.0, 2, 2002, "デュラン", "キャラバンコインではなく\n首で支払って貰えんかのぅ\n…冗談であるぞ？");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (2, 2, "2025/09/22 14:59:59", 0.0, 9, 10034, "2025/06/16 15:00:00", 0.0, 135902, -470.0, 1, 2002, "サツキ", "おう\n好きなもん持ってきな");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (6, 1, "2025/09/22 14:59:59", 0.0, 9, 10035, "2025/06/16 15:00:00", 4.935, 135902, -470.0, 2, 2002, "サツキ", "宵越しの銭を持つような\n野暮いマネぁしくさんな\nツキが落ちてもしらねぇぜ");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (5, 2, "2025/09/22 14:59:59", 0.0, 9, 10036, "2025/06/16 15:00:00", 7.441, 135802, -470.0, 1, 2002, "ユキノ", "ら、ら、らっしゃっせ…\nなんかほしいもん、ある？\nか、かき氷とか、ど…？");
INSERT INTO `v1_86e05ee838dc4123de73ddf7a24c02e1b7999ce55de89654e4b173d8ab903e40` VALUES (7, 7, "2025/09/22 14:59:59", 0.0, 9, 10037, "2025/06/16 15:00:00", 0.0, 135802, -470.0, 2, 2002, "ユキノ", "そ、そんな見ねぇで…\nあては、売りもんじゃ\nねぇよ…？");
